import{_ as o,c as s,o as l,V as e}from"./chunks/framework.3d11d069.js";const h=JSON.parse('{"title":"HTML 面试题","description":"","frontmatter":{},"headers":[],"relativePath":"pages/interview/all/html.md","filePath":"pages/interview/all/html.md","lastUpdated":1690294571000}'),a={name:"pages/interview/all/html.md"},c=e('<h1 id="html-面试题" tabindex="-1">HTML 面试题 <a class="header-anchor" href="#html-面试题" aria-label="Permalink to &quot;HTML 面试题&quot;">​</a></h1><h2 id="href-和-src-的区别" tabindex="-1"><code>href</code> 和 <code>src</code> 的区别 <a class="header-anchor" href="#href-和-src-的区别" aria-label="Permalink to &quot;`href` 和 `src` 的区别&quot;">​</a></h2><h3 id="src" tabindex="-1">src <a class="header-anchor" href="#src" aria-label="Permalink to &quot;src&quot;">​</a></h3><ol><li>请求的资源会内嵌到元素当中，比如图片用的 src 指向的图片链接</li><li>请求的资源会应用到文档内的，比如 script，浏览器会<strong>暂停其他资源的下载</strong>，等待其加载 编译执行完成</li></ol><h3 id="href" tabindex="-1">href <a class="header-anchor" href="#href" aria-label="Permalink to &quot;href&quot;">​</a></h3><ol><li>表示文本的引用，指向网络资源，建立和当前元素或本文档的链接关系</li><li>浏览器会并行下载，不会阻断其他资源的加载，如a、link标签</li></ol><h2 id="img-的-title-和-alt-的区别" tabindex="-1">img 的 title 和 alt 的区别 <a class="header-anchor" href="#img-的-title-和-alt-的区别" aria-label="Permalink to &quot;img 的 title 和 alt 的区别&quot;">​</a></h2><ul><li><code>title</code> 通常是鼠标滑动到元素上的时候显示的</li><li><code>alt</code> 是 <code>img</code> 特有的属性，是图片内容的等价描述，用于图片无法加载时显示。可以提高图片的可访问性，建议设置有意义的值，SEO 会重点分析</li></ul><h2 id="语义化理解" tabindex="-1">语义化理解 <a class="header-anchor" href="#语义化理解" aria-label="Permalink to &quot;语义化理解&quot;">​</a></h2><p>根据内容的结构来选择合适的标签</p><p>优点：</p><ol><li>对机器友好，有利于网站的 SEO，有利于搜索引擎的爬取有效信息</li><li>对开发者来说，可以增强可读性，结构更加清晰，便于维护</li></ol><h2 id="doctype-的作用" tabindex="-1">DOCTYPE 的作用 <a class="header-anchor" href="#doctype-的作用" aria-label="Permalink to &quot;DOCTYPE 的作用&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">doctype</p><p><code>doctype</code> 是 <code>html5</code> 一种标准通用标记语言的<strong>文档类型声明</strong>，目的是告诉浏览器是以 <code>html</code> 还是 <code>xhtml</code> 的文档类型来解析文档，不同的渲染模式会影响浏览器的 css 和 js 的解析</p><p>来自 MDN文档</p></div><p>可以通 <code>document.compatMode</code> 来获取，使用的模式</p><ul><li><code>CSS1Compat</code>：严格模式，默认浏览器用 W3C 标准解析，以其支持的<strong>最高标准呈现页面</strong></li></ul><blockquote><p><code>&lt;!doctype html&gt;</code> 作用是让浏览器进入标准模式</p></blockquote><ul><li><code>BackCompat</code>：怪异模式，使用怪异模式解析渲染，以一种比较宽松的<strong>向后兼容</strong>的方式显示</li></ul><p>网页中的 <code>DTD</code>，直接影响是什么模式</p><ol><li>如果文档包含严格的 <code>DOCTYPE</code>，就一般以严格模式呈现</li><li>包含过渡 <code>DTD</code> 和 <code>URI</code> 的 <code>DOCTYPE</code>，也以严格模式</li><li>但是有过渡 <code>DTD</code> 没有 <code>URI</code>，就以混杂模式</li><li>没有 <code>DOCTYPE</code> 或形式不正确会以混杂模式呈现</li><li><code>html5</code> 没有 <code>DTD</code> 就没有严格模式和混杂模式的区别</li></ol><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>URI: 统一资源标识符，就是声明最后的地址</p></div><h2 id="script-标签的-defer-和-async-的区别" tabindex="-1">Script 标签的 defer 和 async 的区别 <a class="header-anchor" href="#script-标签的-defer-和-async-的区别" aria-label="Permalink to &quot;Script 标签的 defer 和 async 的区别&quot;">​</a></h2><p>共同点：都是<strong>异步加载</strong>外部的 js，加载时不会阻塞页面的解析 不同点：</p><blockquote><p>执行顺序不同</p></blockquote><ul><li>多个带有 <code>async</code> 属性的标签，<strong>不能保证执行的顺序，加载完就执行</strong>，有可能会阻塞 html 的渲染</li><li>多个带有 <code>defer</code> 属性的标签，可以保证执行的顺序</li></ul><blockquote><p>脚本是否并行执行</p></blockquote><ul><li><code>async</code> 表示后续文档的<strong>加载和执行</strong>与 <code>js</code> 脚本的<strong>加载执行是并行的</strong></li><li><code>defer</code> 加载文档和 <code>js</code> 脚本的<strong>加载是并行</strong>的，但是 <code>js</code> 脚本要等到文档所有元素解析完成后执行，也就是 <code>DOMContentLoaded</code> 之前执行</li></ul><h2 id="iframe-的优缺点" tabindex="-1">iframe 的优缺点 <a class="header-anchor" href="#iframe-的优缺点" aria-label="Permalink to &quot;iframe 的优缺点&quot;">​</a></h2><p><code>iframe</code> 会创建包含另一个文档的内联框架</p><p>优点：</p><ol><li>可以用来加载速度比较慢的内容</li><li>脚本会并行下载</li><li>实现跨子域通信</li></ol><p>缺点：</p><ol><li><code>iframe</code> 会阻塞主页面的 <code>onLoad</code> 事件</li><li>无法被搜索引擎识别</li><li>产生很多页面，不易管理</li><li><code>iframe</code> 和主页面共享连接池，而浏览器对相同域的连接有限制，所以会影响页面的并行加载</li></ol><p>使用 <code>iframe</code> 之前需要考虑这两个缺点。如果需要使用 <code>iframe</code>，最好是通过 <code>js</code> 动态给 <code>iframe</code> 添加 <code>src</code> 属性值，可以避免这个问题</p><h2 id="title-和-h1-的区别-b-和-strong-的区别-i-和-em-的区别" tabindex="-1"><code>title</code> 和 <code>h1</code> 的区别，<code>b</code> 和 <code>strong</code> 的区别，<code>i</code> 和 <code>em</code> 的区别 <a class="header-anchor" href="#title-和-h1-的区别-b-和-strong-的区别-i-和-em-的区别" aria-label="Permalink to &quot;`title` 和 `h1` 的区别，`b` 和 `strong` 的区别，`i` 和 `em` 的区别&quot;">​</a></h2><ol><li><code>strong</code> 有语义化起到加重语气的效果，<code>b</code> 只是简单的加粗，搜索引擎更侧重 <code>strong</code></li><li><code>title</code> 没有明确意义，只是标题 <code>h1</code> 表示层次明确的标题，对信息抓取有很大影响</li><li><code>i</code> 内容展示为斜体，<code>em</code> 表示强调的文本</li></ol><h2 id="行内元素、块级元素、空元素有哪些" tabindex="-1">行内元素、块级元素、空元素有哪些 <a class="header-anchor" href="#行内元素、块级元素、空元素有哪些" aria-label="Permalink to &quot;行内元素、块级元素、空元素有哪些&quot;">​</a></h2><p>行内元素：<code>a</code>、<code>b</code> 、<code>span</code>、<code>img</code>、<code>input</code>、<code>select</code>、<code>strong</code></p><p>块级元素：<code>div</code>、<code>ul</code>、<code>ol</code>、<code>li</code>、<code>dl</code>、<code>dt</code>、<code>dd</code>、<code>h1</code>、<code>p</code></p><p>行内块元素：<code>img</code>、<code>input</code></p><p>空元素就是没有内容的 html：常见的有 <code>br</code>、<code>hr</code>、<code>img</code>、<code>input</code>、<code>link</code>、<code>meta</code></p><h2 id="canvas-和-svg-的区别" tabindex="-1">canvas 和 svg 的区别 <a class="header-anchor" href="#canvas-和-svg-的区别" aria-label="Permalink to &quot;canvas 和 svg 的区别&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">SVG</p><p><code>svg</code> 是基于 <code>xml</code> 描述的 <code>2d</code> 图形的语言，<code>svg</code> <code>dom</code> 中的每个元素都是可用的，可以为某个元素附加 <code>js</code> 事件处理器，在 <code>svg</code> 中，每个被绘制的图形都可被视为对象，如果 <code>svg</code> 对象属性发生变化，浏览器可以自动重现图形</p></div><ul><li>不依赖分辨率</li><li>支持事件处理器</li><li>适合大型区域应用</li><li>对数据敏感</li><li>不适合游戏应用</li></ul><div class="tip custom-block"><p class="custom-block-title">Canvas</p><p>通过 JS 绘制 2d 图形，逐像素渲染，位置改变就重新绘制</p></div><ul><li>依赖分辨率 DPR</li><li>不支持事件处理器</li><li>文本渲染能力弱</li><li>可以保存结果图像</li><li>适合图像密集型游戏</li></ul><h2 id="常见的-meta-标签" tabindex="-1">常见的 meta 标签 <a class="header-anchor" href="#常见的-meta-标签" aria-label="Permalink to &quot;常见的 meta 标签&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">meta</p><p>由 name 和 content 属性定义，用户描述网页文档的属性</p></div><ol><li><code>charset</code> 用于描述 <code>html</code> 编码类型</li></ol><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">meta</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">charset</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">UTF-8</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;"> &gt;</span></span></code></pre></div><ol start="2"><li><code>keywords</code> 页面关键词</li></ol><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">meta</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">name</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">keywords</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">content</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">关键词</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;"> /&gt;</span></span></code></pre></div><ol start="3"><li><code>description</code> 页面描述</li></ol><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">meta</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">name</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">description</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">content</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">页面描述内容</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;"> /&gt;</span></span></code></pre></div><ol start="4"><li><code>refresh</code> 页面的重定向和刷新</li></ol><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">meta</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">http-equiv</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">refresh</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">content</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">0;url=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">&quot; /&gt;</span></span></code></pre></div><ol start="5"><li><code>viewport</code> 适配移动端 可控制视口大小和比例</li></ol><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">meta</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">name</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">viewport</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">content</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">width=device-width, initial-scale=1, maximum-scale=1</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><ul><li>其中，<code>content</code> 参数有以下几种： <ul><li><p><code>width viewport</code> ：宽度(数值/<code>device-width</code>)</p></li><li><p><code>height viewport</code> ：高度(数值/<code>device-height</code>)</p></li><li><p><code>initial-scale</code> ：初始缩放比例</p></li><li><p><code>maximum-scale</code> ：最大缩放比例</p></li><li><p><code>minimum-scale</code> ：最小缩放比例</p></li><li><p><code>user-scalable</code> ：是否允许用户缩放(<code>yes</code>/<code>no</code>）</p></li></ul></li></ul><ol start="6"><li><code>robot</code> 搜索引擎索引方式</li></ol><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">meta</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">name</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">robots</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C792EA;">content</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">index,follow</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;"> /&gt;</span></span></code></pre></div><ul><li><p>其中，<code>content</code> 参数有以下几种：</p><ul><li><p><code>all</code>：文件将被检索，且页面上的链接可以被查询；</p></li><li><p><code>none</code>：文件将不被检索，且页面上的链接不可以被查询；</p></li><li><p><code>index</code>：文件将被检索；</p></li><li><p><code>follow</code>：页面上的链接可以被查询；</p></li><li><p><code>noindex</code>：文件将不被检索；</p></li><li><p><code>nofollow</code>：页面上的链接不可以被查询。</p></li></ul></li></ul><h2 id="head-标签有什么作用" tabindex="-1">head 标签有什么作用 <a class="header-anchor" href="#head-标签有什么作用" aria-label="Permalink to &quot;head 标签有什么作用&quot;">​</a></h2><blockquote><p>用于定义文档头部，可以引用脚本、样式表</p></blockquote><p>下列标签可以用于 head</p><ul><li><p><code>&lt;base&gt;</code></p></li><li><p><code>&lt;link&gt;</code></p></li><li><p><code>&lt;meta&gt;</code></p></li><li><p><code>&lt;script&gt;</code></p></li><li><p><code>&lt;style&gt;</code></p></li><li><p><code>&lt;title&gt;</code> <strong>唯一必须元素</strong></p></li></ul><h2 id="label-标签的作用" tabindex="-1"><code>label</code> 标签的作用 <a class="header-anchor" href="#label-标签的作用" aria-label="Permalink to &quot;`label` 标签的作用&quot;">​</a></h2><blockquote><p>当选择 label 标签时，浏览器会将焦点转移到和 label 标签相关的表单控件上</p></blockquote><p>两种使用方法</p><ol><li><code>label</code>里面的<code>for</code>与<code>id</code>的值相同</li></ol><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">label</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">for</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">mobile</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;">Number:</span><span style="color:#89DDFF;">&lt;/</span><span style="color:#F07178;">label</span><span style="color:#89DDFF;">&gt;</span></span>\n<span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">input</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">type</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">text</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">id</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">mobile</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">/&gt;</span></span></code></pre></div><ol start="2"><li><code>label</code>包裹着<code>input</code>标签</li></ol><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">label</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;">Date:</span><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">input</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">type</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">text</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">/&gt;&lt;/</span><span style="color:#F07178;">label</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><h2 id="img-的-srcset-属性的作用" tabindex="-1"><code>img</code> 的 <code>srcset</code> 属性的作用 <a class="header-anchor" href="#img-的-srcset-属性的作用" aria-label="Permalink to &quot;`img` 的 `srcset` 属性的作用&quot;">​</a></h2><p>响应式页面根据<strong>屏幕密度</strong>不同设置不同的图片</p><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">img</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">src</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">/Users/xiaosong/Downloads/image-128.png</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">srcset</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">image-256.png 2x</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;"> /&gt;</span></span></code></pre></div><p>上述代码在 <code>1x</code> 时候加载 <code>image-128.png</code></p><p>在 <code>2x</code> 的时候加载 <code>imges-256.png</code>，现在有<code>1x</code> <code>2x</code> <code>3x</code> <code>4x</code></p><p>每一个图片都设置<code>4</code>张图片加载就会很慢，于是有了新的 <code>srcset</code> 标准</p><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">img</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">src</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">image-128.png</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">srcset</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">image-128.png 128w, image-256.png 256w, image-512.png 512w</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">sizes</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">(max-width: 360px) 340px, 128px</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;"> /&gt;</span></span></code></pre></div><ul><li><code>srcset</code> 指定图片地址和对应图片质量</li><li><code>sizes</code> 设置图片的尺寸临界点</li></ul><p>语法：<code>sizes=&quot;[media query] [length], [media query] [length] ... &quot;</code></p><ul><li><code>sizes</code>就是指默认显示<code>128px</code>, 如果视区宽度大于<code>360px</code>, 则显示<code>340px</code>。</li><li><code>w</code>单位理解为图片质量，可视区小于这个质量的值就会使用</li></ul><h2 id="html5-新特性" tabindex="-1">HTML5 新特性 <a class="header-anchor" href="#html5-新特性" aria-label="Permalink to &quot;HTML5 新特性&quot;">​</a></h2><h3 id="媒体标签" tabindex="-1">媒体标签 <a class="header-anchor" href="#媒体标签" aria-label="Permalink to &quot;媒体标签&quot;">​</a></h3><p><strong>audio 音频</strong></p><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">audio</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">src</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&#39;&#39;</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">controls</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">autoplay</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">loop</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">true</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;">&gt;&lt;/</span><span style="color:#F07178;">audio</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><p>属性：<code>controls</code> 控制面板</p><ul><li>autoplay 自动播放</li><li>loop 循环播放</li></ul><p><strong>video 视频</strong></p><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">video</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">src</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&#39;&#39;</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">poster</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">imgs/aa.jpg</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">controls</span><span style="color:#89DDFF;">&gt;&lt;/</span><span style="color:#F07178;">video</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><ul><li><p>属性：<code>poster</code> 指定视频还没下载完毕，用户尚未点击播放前显示的封面，默认为第一帧，也可以自己设置</p><ul><li><code>controls</code> 控制面板</li><li><code>width</code> <code>height</code></li></ul></li><li><p><code>source</code>标签，兼容浏览器</p></li></ul><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">video</span><span style="color:#89DDFF;">&gt;</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">source</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">src</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">aa.flv</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C792EA;">type</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">video/flv</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;"> /&gt;</span></span>\n<span class="line"><span style="color:#A6ACCD;">  </span><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">source</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">src</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">aa.mp4</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C792EA;">type</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">video/mp4</span><span style="color:#89DDFF;">&#39;</span><span style="color:#89DDFF;"> /&gt;</span></span>\n<span class="line"><span style="color:#89DDFF;">&lt;/</span><span style="color:#F07178;">video</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><h3 id="表单" tabindex="-1">表单 <a class="header-anchor" href="#表单" aria-label="Permalink to &quot;表单&quot;">​</a></h3><ul><li><code>emails</code> 验证当前输入邮箱地址是否合法</li><li><code>url</code> 验证<code>url</code></li><li><code>number</code> 只能输入数字，自带上下增大减小箭头，<code>max</code> <code>min</code>分别设置最大最小</li><li><code>search</code> 输入框最后会有一个小<code>×</code>，可以删除输入</li><li><code>range</code> 提供一个范围，其中可以设置<code>max</code>和<code>min</code>以及<code>value</code>，<code>value</code>为默认值</li><li><code>color</code> 提供颜色拾取器</li><li><code>time</code> 时分秒</li><li><code>date</code> 日期选择年月日</li><li><code>datetime</code> 时间和日期(只支持<code>Safari</code>)</li><li><code>datetime-local</code> 日期时间控件</li><li><code>week</code> 周控件</li><li><code>month</code> 月控件</li></ul><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">input</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">type</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">emails</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><h3 id="表单属性" tabindex="-1">表单属性 <a class="header-anchor" href="#表单属性" aria-label="Permalink to &quot;表单属性&quot;">​</a></h3><ul><li><code>oninput</code> 当输入框内容发生变化触发</li><li><code>onvalid</code> 当验证不通过时触发</li></ul><h3 id="进度条、度量条" tabindex="-1">进度条、度量条 <a class="header-anchor" href="#进度条、度量条" aria-label="Permalink to &quot;进度条、度量条&quot;">​</a></h3><ul><li><code>progress</code>标签：表示任务的进度(<code>ie</code>，<code>Safari</code>不支持)，<code>max</code>表示任务的进度，<code>value</code>表示已完成多少</li><li><code>meter</code> 显示剩余容量或剩余库存</li><li><code>high/low</code>：高低范围</li><li><code>max/min</code>: 最大/小值</li><li><code>value</code>: 当前度量衡</li></ul><div class="language-html"><button title="Copy Code" class="copy"></button><span class="lang">html</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#89DDFF;">&lt;</span><span style="color:#F07178;">progress</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">value</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">70</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;"> </span><span style="color:#C792EA;">max</span><span style="color:#89DDFF;">=</span><span style="color:#89DDFF;">&quot;</span><span style="color:#C3E88D;">100</span><span style="color:#89DDFF;">&quot;</span><span style="color:#89DDFF;">&gt;</span><span style="color:#A6ACCD;">70</span><span style="color:#89DDFF;">&lt;/</span><span style="color:#F07178;">progress</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><h3 id="drag-api" tabindex="-1">Drag API <a class="header-anchor" href="#drag-api" aria-label="Permalink to &quot;Drag API&quot;">​</a></h3><ul><li><code>dragstart</code> 事件主体是<strong>被拖放元素</strong>，再<strong>开始拖放</strong>被拖放元素时触发</li><li><code>drag</code> 事件的主体是<strong>被拖放的元素</strong>，<strong>正在</strong>被拖放元素时触发</li><li><code>dragenter</code> 事件主体是<strong>目标元素</strong>，在被拖放元素<strong>进入</strong>某元素时触发</li><li><code>dragover</code> 事件主体是<strong>目标元素</strong>，再被拖放元素内<strong>移动</strong>时触发</li><li><code>dragleave</code> 事件的主体是<strong>目标元素</strong>，在被拖放元素<strong>移除</strong>目标时触发</li><li><code>drop</code> 事件主体是<strong>被拖放元素</strong>，在目标元素完全<strong>接收</strong>被拖放元素时触发</li></ul><h2 id="前端需要注意哪些-seo" tabindex="-1">前端需要注意哪些 SEO <a class="header-anchor" href="#前端需要注意哪些-seo" aria-label="Permalink to &quot;前端需要注意哪些 SEO&quot;">​</a></h2><ul><li>合理的 <code>title</code> <code>description</code> <code>keywords</code>：搜索引擎对这三项的权重逐个减小 <ul><li><code>title</code> 值强调重点即可，<strong>重要关键词出现不要超过 2 次</strong>，而且要靠前，不同页面 <code>title</code> 要不同</li><li><code>description</code> 把页面内容<strong>高度概括，长度合适</strong>，不可过分堆砌关键词，不同页面 <code>description</code> 应当不同</li><li><code>keywords</code> 列举出<strong>重要关键词</strong></li></ul></li><li><strong>语义化的 HTML 代码</strong>，符合 W3C 规范，语义化代码让搜索引擎更容易理解网页</li><li><strong>重要内容 HTML 代码放在最前</strong>：搜索引擎抓取 HTML 的顺序是从上到下，有的搜索引起对抓取的长度有限制，因此要确保重要内容被抓取到</li><li>重要内容不要用 JS 输出，<strong>爬虫不会执行 JS 获取内容</strong></li><li><strong>少用 iframe</strong>：搜索引擎不会抓取 iframe 中的内容</li><li>非装饰性图片必须加 <code>alt</code></li><li>提高<strong>网站速度</strong>：网站速度是搜索引擎排序的一个重要指标</li></ul><h2 id="html5-的离线储存怎么使用-工作原理能不能解释一下" tabindex="-1">HTML5 的离线储存怎么使用，工作原理能不能解释一下？ <a class="header-anchor" href="#html5-的离线储存怎么使用-工作原理能不能解释一下" aria-label="Permalink to &quot;HTML5 的离线储存怎么使用，工作原理能不能解释一下？&quot;">​</a></h2><ul><li>在用户没有网络下，可以正常访问站点，在有网时，更新缓存文件</li></ul><p>原理</p><ul><li><p><code>HTML5</code>的离线存储是基于一个新建的<code>.appcache</code>文件的缓存机制(不是存储技术)，通过这个文件上的解析清单离线存储资源，这些资源就会像<code>cookie</code>一样被存储了下来。之后当网络在处于离线状态下时，浏览器会通过被离线存储的数据进行页面展示</p></li><li><p>如何使用：</p><ul><li>页面头部像下面一样加入一个<code>manifest</code>的属性；</li><li>在<code>cache.manifest</code>文件的编写离线存储的资源</li><li>在离线状态时，操作<code>window.applicationCache</code>进行需求实现</li></ul></li></ul><div class="language-json"><button title="Copy Code" class="copy"></button><span class="lang">json</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">CACHE MANIFEST</span></span>\n<span class="line"><span style="color:#A6ACCD;">#v</span><span style="color:#F78C6C;">0.11</span></span>\n<span class="line"><span style="color:#A6ACCD;">CACHE:</span></span>\n<span class="line"><span style="color:#A6ACCD;">js/app.js</span></span>\n<span class="line"><span style="color:#A6ACCD;">css/style.css</span></span>\n<span class="line"><span style="color:#A6ACCD;">NETWORK:</span></span>\n<span class="line"><span style="color:#A6ACCD;">resourse/logo.png</span></span>\n<span class="line"><span style="color:#A6ACCD;">FALLBACK:</span></span>\n<span class="line"><span style="color:#A6ACCD;">/offline.html</span></span></code></pre></div><h2 id="浏览器是怎么对-html5-的离线储存资源进行管理和加载的呢" tabindex="-1">浏览器是怎么对 HTML5 的离线储存资源进行管理和加载的呢？ <a class="header-anchor" href="#浏览器是怎么对-html5-的离线储存资源进行管理和加载的呢" aria-label="Permalink to &quot;浏览器是怎么对 HTML5 的离线储存资源进行管理和加载的呢？&quot;">​</a></h2><ul><li>在线的情况下，浏览器发现<code>html</code>头部有<code>manifest</code>属性，它会请求<code>manifest</code>文件，如果是第一次访问<code>app</code>，那么浏览器就会根据<code>manifest</code>文件的内容下载相应的资源并且进行离线存储。如果已经访问过<code>app</code>并且资源已经离线存储了，那么浏览器就会使用离线的资源加载页面，然后浏览器会对比新的<code>manifest</code>文件与旧的<code>manifest</code>文件，如果文件没有发生改变，就不做任何操作，如果文件改变了，那么就会重新下载文件中的资源并进行离线存储。</li><li>离线的情况下，浏览器就直接使用离线存储的资源。</li></ul>',112),n=[c];function t(p,i,d,r,D,F){return l(),s("div",null,n)}const u=o(a,[["render",t]]);export{h as __pageData,u as default};
